import React, { Component } from 'react';




class CallTo extends Component {

    render (){

        return (
        <section id="contact">

            <div>
                <h2>Let's work together...</h2>
                <p>How do you take your coffee?</p>
            </div>

            <div>

                <a class="btn contact-details" href="https://github.com/yonkeenn" target="_blank">
                    <i class="fab fa-github"></i>
                    GitHub
                </a>

                <a class="btn contact-details" href="mailto:jhon.vargasr@gmail.com" target="_blank">
                    <i class="fas fa-at"></i>
                    Send me Email
                </a>

                <a class="btn contact-details" href="tel:+51-997502031" target="_blank">
                    <i class="fas fa-mobile-alt"></i>
                    Call me
                </a>

            </div>

        </section>

    );

    }
    }

    export default CallTo;
